var prefix = window.location.pathname.substr( 0, window.location.pathname.toLowerCase().lastIndexOf( "/extensions" ) + 1 );
var config = {
	host: window.location.hostname,
	prefix: prefix,
	port:443,
	isSecure: true
};





settings = {
  component: "expandable-items",
  label: "Settings",
  items: {
    part: {
      type: "items",
      label: "Keep Alive",
      items: {
        timeoutTime: {
          ref: "timeoutTime",
          label: "Frequency (minutes)",
          type: "string",
          expression: "required",
          defaultValue: "25"
        },
        Minimum: {
          label:"Minimum value is 14",
          component: "text"
        }
      },
    },
  },
};

var definition = {
  type: "items",
  component: "accordion",
  items: {
    settings: settings,
  },
};

define(['qlik', 'jquery'
], function (qlik, $) {
  // 'use strict';
  styles = '.novartis-keep-alive{display:none}.qv-mode-edit .novartis-keep-alive{display:flex;align-items:center;height:100%;}.qv-object-NovartisKeepAlive{border:0 !important} .qv-object-NovartisKeepAlive .qv-inner-object{background:transparent !important}';
  $("<style>")
    .html(styles)
    .appendTo("head");

  return {
    snapshot: { canTakeSnapshot: true },
    definition: definition,
    paint: function ($element, layout) {      
      $element.html('<div class="novartis-keep-alive"><img style="width: 100%;" src="data:image/png;base64,"></div>');
      var app = qlik.currApp();
      var time;
      timeout = 25 * 60000;
      time = window.setInterval(function () {
        app.getList('VariableList');
        if(!!layout.timeoutTime) { 
          clearInterval(time);
        }        
      }, timeout);

      if(!!layout.timeoutTime) { 

        if(layout.timeoutTime < 14) {
          layout.timeoutTime = 14;
        } 
        console.log('layout.timeoutTime', layout.timeoutTime);
        timeout = layout.timeoutTime * 60000;

        time = window.setInterval(function () {
          app.getList('VariableList');
        }, timeout);
      }

    },
  };
});
